      | 355820 -> { ItemTypeData.id= 355820; name= "Burst Heavy Machine Gun"; published= false; description= "A multi-barrel, rotary drive machine gun, the HMG is a singularly devastating anti-infantry weapon. Eschewing the advantages of a lighter frame in favor of stopping power, the exponentially increased heat and vibration produced by this Boundless Creation developed weapon makes it almost unbearable to fire. Yet despite this fact, its above average hit ratio and extreme rate of fire has earned it the nickname “Death's Engine.”  Unlike earlier models, the weapon requires no spool up time; rounds are expelled the instant the trigger is pressed. This comes at the cost of initially reduced accuracy as the counter-rotating drives slowly align. Once fully aligned, however, the HMG produces a pinpoint stream of gunfire with unmatched killing potential."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 356111 -> { ItemTypeData.id= 356111; name= "'Valor' Logistics M-I"; published= false; description= "The Logistics dropsuit is outfitted with the latest in integrated diagnostic technology, most of which revolves around maintaining the condition and efficiency of squad mates and their equipment. As such, a soldier equipped with this class of dropsuit becomes a force multiplier, greatly improving the overall effectiveness of the unit.  Utilizing a combination of high- and low-tech equipment, operators of the logistics suit are able to make effective repairs to installations, vehicles, and even other soldiers; every apparatus required for field triage is present and easily accessible from the utility pockets and satchels attached to the suit. Its hydraulic assisted exoskeleton allows the wearer to effortlessly hoist heavy equipment, while the helmet is packed with material scanners sensitive enough to spot microfractures in layered steel.  When deployed, a soldier equipped with a Logistics suit fills a vital tactical role in small unit operations and full-scale warfare, providing both, medical and mechanical support."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
