      | 35914 -> { ItemTypeData.id= 35914; name= "Standup Cynosural System Jammer I"; published= true; description= "The Standup Cynosural System Jammer is a service module that prevents the activation of standard Cynosural Field Generator modules within an entire star system. Activating this module begins a 5 minute warmup period during which capsuleers within the system will be able to detect that a cynosural jamming effect is imminent. Once the 5 minute period is complete all standard Cynosural Field Generator modules will be unable to begin new cycles of operation. Covert Cynosural Field Generators are immune to this disruption.    This service module may only be onlined in a system that contains an Infrastructure Hub with the <a href=showinfo:2001>Cynosural Suppression</a> upgrade active.  This service module is automatically included built-in to every Upwell <a href=showinfo:37534>Tenebrex Cyno Jammer</a>, and cannot be removed from that structure.    Standup is a proprietary system that uses a Structure Autonomous Nanoassembly Device (Upwell) containing integrated template software, a nanoassembler array and sufficient nanomass to enable the construction of a variety of service modules, structure modules and structure rigs when inserted into the appropriate slots on a structure built with Upwell technology."; marketGroupId= None; groupId= 1324; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 1000000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 500.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 2791; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 2334; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 2794; value= 300000.000000 }; { DogmaAttributeValueData.attributeId = 1074; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 50; value= 10000.000000 }; { DogmaAttrib