      | 364744 -> { ItemTypeData.id= 364744; name= "Medic - MN"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.  Native Minmatar tech favors straightforward solutions, a consequence of the fledgling Nation’s indigent past. Stripped of the haptic bindings and sensor technology of the Logistics suit, the Assault variant is a lightweight, low-power solution that utilizes a combination of shielding and resistive plating to thwart enemy fire. Its slimline hydraulic assisted exoskeleton enhances movement speed and user strength, while hard shell reactive armor protects the wearer from a wide-range of small arms ballistics. A mimetic recycler stores and reroutes excess power as needed.  Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 36496 -> { ItemTypeData.id= 36496; name= "Men's 'Hephaestus' Pants (cyan)"; published= true; description= "Designer: Vallou Outerwear  When Outer Ring Excavations was looking to update and modernize their crew uniforms, they relied on Vallou Outerwear to take on the challenge. Vallou upper management was so impressed with the result, they commissioned a limited range of custom variants, known as the “Hephaestus” collection.   These functional but high tech pants retain the utilitarian look of the original uniforms, but with much higher material quality and attention to detail. Each pair of pants are crafted from cyan-shaded poly fabrics that are extremely durable yet comfortable enough to wear for extended periods. Additional pockets, straps and utility belts allow for a wide range of tools to be carried with the wearer while performing their duties.  "; marketGroupId= Some(1401); groupId= 1090; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 1773; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
      | 365229 -> { ItemTypeData.id= 365229; name= "Basic Ferroscale Plates"; published= false; description= "Ultra-light alloy that increases the maximum strength of dropsuit armor without affecting movement speed."; marketGroupId= None; groupId= 351121; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365326 -> { ItemTypeData.id= 365326; name= "'Neo' Scout mk.0"; published= false; description= "The Scout dropsuit is a lightweight suit optimized for enhanced mobility, multi-spectrum stealth, and heightened awareness. Augmented joint servo motors give every movement extra speed and flexibility, while integrated friction and impact dampening materials reduce the overall sound signature.     Biotic augments make this suit ideal for a melee-focused role. Woven into the suit, a tremor membrane saturates muscles with nutrients amplifying the cross-sectional force of physical strikes. Combined with rigorous training, this temporarily enhanced strength and dexterity make the Minmatar Scout almost unmatched in hand-to-hand combat.     When missions call for speed and stealth, situations in which heavily armored suits would be more of a burden than an advantage, a scout dropsuit is the best option. The enhanced mobility it provides makes up for its relatively low protection, and when combined with stealth technology modules, the scout suit is the obvious choice for infiltration, counter-espionage, and assassination."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365714 -> { ItemTypeData.id= 365714; name= "'Pyrus' Logistics ak.0"; published= false; description= "Utilizing sub-licensed technology sourced from all across the cluster, Allotek Industries’ Pyrus product line offers a wide range of dropsuit and weapon variants developed and manufactured in accordance with the corporation’s stringent guidelines to ensure that all products are worthy of carrying the Allotek quality guarantee."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
