      | 366684 -> { ItemTypeData.id= 366684; name= "'Neo' Sentinel C/1-Series"; published= false; description= "The Sentinel dropsuit is a second-generation solution designed to withstand concentrated small arms fire and protect the wearer from the concussive, thermal, and impact forces of low-grade explosives. Additionally, its power-assisted exoskeleton facilitates usage of the heaviest caliber personal weapons.    Designed for maximum energy absorption, the Caldari Sentinel’s shielding system features an elevated saturation threshold, allowing it to dissipate a greater amount of energy in order to maintain overall shield integrity. Additionally, highly efficient refraction systems make subtle adjustments to the overlapping fields that comprise the shielding surface area, diverting minute amounts of incoming energy and dampening the effective damage of certain small arms fire.    Heavy dropsuits lack the mobility of lighter suits, but this trade-off results in a defensive system that defies standard infantry conventions. No other classification of personal armor can claim to be able to stand toe-to-toe with enemy vehicles and survive."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 367654 -> { ItemTypeData.id= 367654; name= "'Quafe' Assault A-I"; published= false; description= "Regarded as one of the most outrageous promotional stunts in the company’s history, the Quafesuit has been called both ‘genius’ and ‘loathsome’. Love it or hate it, none can deny its effectiveness as a marketing ploy, though many have questioned how the softdrink giant was able to procure a shipment of dropsuits in the first place."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 367751 -> { ItemTypeData.id= 367751; name= "Logibro's Modified Logistics mk.0"; published= false; description= "The Logistics dropsuit is outfitted with the latest in integrated diagnostic technology, most of which revolves around maintaining the condition and efficiency of squad mates and their equipment. As such, a soldier equipped with this class of dropsuit becomes a force multiplier, greatly improving the overall effectiveness of the unit.  Utilizing a combination of high- and low-tech equipment, operators of the logistics suit are able to make effective repairs to installations, vehicles, and even other soldiers; every apparatus required for field triage is present and easily accessible from the utility pockets and satchels attached to the suit. Its hydraulic assisted exoskeleton allows the wearer to effortlessly hoist heavy equipment, while the helmet is packed with material scanners sensitive enough to spot microfractures in layered steel.  When deployed, a soldier equipped with a Logistics suit fills a vital tactical role in small unit operations and full-scale warfare, providing both, medical and mechanical support.  This particular suit is the result of personal development by a figure only known as  Logibro . Optimized for survivability, this dropsuit provides additional protection through both strengthened armor and shielding, and the addition of more powerful sensors."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 367848 -> { ItemTypeData.id= 367848; name= "Federation Burst Assault Rifle"; published= false; description= "Conceived by Duvolle Laboratories, a corporation best known for its ceaseless R&D, the G75-VLB solves many of the problems inherent in mass-manufactured plasma weapons. The result is a weapon that offers improved accuracy and greater containment field stability (which equates to faster, longer bursts of fire) than anything in its class.   It is a magazine-fed, short-to-mid range weapon offering fully automatic fire. Charged plasma munitions are pumped into a cyclotron that converts the plasma into a highly lethal bolt before it is expelled from the chamber. Upon impact with the target, the magnetic field surrounding the bolt collapses, venting superheated plasma onto the contact point."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
